function adaptToChangedSize() {
    if (touchdevice) {
        fieldsize = Math.floor((width - fields[0].length) / (fields.length + 1));
        rackfieldsize = Math.floor((width - fields[0].length) / racksize);
    } else {
        fieldsize = Math.floor((height - fields.length) / (fields.length + 4));
        rackfieldsize = fieldsize;
    }
    fontsizeletter = Math.floor(fieldsize * 0.8).toString() + "px";
    fontsizebutton = Math.floor(fieldsize * 0.7).toString() + "px";
    fontsizelabel = Math.floor(fieldsize * 0.4).toString() + "px";
    for (let rindex = 0; rindex < fields.length; rindex++) {
        for (let cindex = 0; cindex < fields[0].length; cindex++) {
            fields[rindex][cindex].style.width = fieldsize.toString() + "px";
            fields[rindex][cindex].style.height = fieldsize.toString() + "px";
        }
    }
    for (let cindex = 0; cindex < rackfields.length; cindex++) {
        rackfields[cindex].style.width = rackfieldsize.toString() + "px";
        rackfields[cindex].style.height = rackfieldsize.toString() + "px";
    }
    let letters = document.querySelectorAll(".letter");
    for (let letter of letters) {
        letter.style.fontSize = fontsizeletter;
        letter.style.width = fieldsize.toString() + "px";
        letter.style.height = fieldsize.toString() + "px";
    }
    let lettersonrack = document.querySelectorAll(".letter-on-rack");
    for (let letter of lettersonrack) {
        letter.style.fontSize = fontsizeletter;
        letter.style.width = rackfieldsize.toString() + "px";
        letter.style.height = rackfieldsize.toString() + "px";
    }
    let dashboardtrs = document.querySelectorAll(".dashboard-tr");
    for (let tr of dashboardtrs) {
        tr.style.height = (fieldsize * 1.1).toString() + "px";
    }
    let buttons = document.querySelectorAll(".UI-button");
    for (let button of buttons) {
        if (touchdevice) {
            button.style.fontSize = fontsizebutton;
            button.parentElement.style.width = Math.floor(width / 4.1).toString() + "px";
            button.style.width = Math.floor(width / 4.1).toString() + "px";
            button.style.height = Math.floor(fieldsize * 1.5).toString() + "px";
        }
        else {
            button.style.fontSize = fontsizebutton;
            button.style.height = Math.floor(fieldsize * 1).toString() + "px";
        }
    }
    let inputs = document.querySelectorAll(".UI-input");
    for (let input of inputs) {
        input.style.fontSize = fontsizebutton;
        input.style.height = Math.floor(fieldsize * 1).toString() + "px";
        if (touchdevice) {
            input.parentElement.style.width = Math.floor(width / 4.2).toString() + "px";
        }
    }
    let labels = document.querySelectorAll(".input-label");
    for (let label of labels) {
        label.style.fontSize = fontsizelabel;
        label.style.height = Math.floor(fieldsize * 0.8).toString() + "px";
    }
    document.querySelector("h1").style.fontSize = fontsizebutton;
    document.querySelector("#small1").style.fontSize = fontsizelabel;
    numberlabelsize = Math.floor(fieldsize * 0.5);
    numberfontsize = Math.floor(fieldsize * 0.3);
}

function adaptToTouchDevice() {
    if (touchdevice) {
        document.querySelector("#dashboard").style.display = "none";
        document.querySelector("#dashboard-top").style.display = "block";
        document.querySelector("#dashboard-bottom").style.display = "block";
        let gameres = document.querySelector("#game-results");
        gameres.style.display = "block";
        gameres.style.width = "100%";
        document.querySelector("body").style.textAlign = "center";
        document.querySelector("#top-form").style.textAlign = "center";
        document.querySelector("#game-div").style.textAlign = "center";
        document.querySelector("#bottom-form").style.textAlign = "center";
    }
    else {
        document.querySelector("#dashboard").style.display = "inline-block";
        document.querySelector("#dashboard-top").style.display = "none";
        document.querySelector("#dashboard-bottom").style.display = "none";
    }
}

function selectBoard(pushedbutton) {
    selectedboardtd = document.querySelector("#selected-board");
    numofselected = document.querySelector("#number-of-selected");
    if (pushedbutton == "left" && selectedboardnum > 0) {
        selectedboardnum--;
    }
    if (pushedbutton == "right" && selectedboardnum < boards.length) {
        selectedboardnum++;
    }
    selectedboard = boards[selectedboardnum][0];
    //selectedboardtd.innerHTML = '';
    alt1 = `${selectedboardnum + 1}` + ". tábla";
    numofselected.innerHTML = `<span>${(selectedboardnum + 1).toString() + "."}</span>`;
    selectedboardtd.innerHTML = `<img style="height: 120px"; src=${boards[selectedboardnum][1]} alt=${alt1}/>`;
}

function getElementPosition(element) {
    let rect = element.getBoundingClientRect();
    return rect;
}

function initGame() {
    let div = document.createElement('div');
    if ('draggable' in div || ('ondragstart' in div && 'ondrop' in div))
        console.log("Drag and Drop API is supported!");
    document.querySelector("#start-screen").style.display = "none";
    document.querySelector("h2").style.display = "inline-block";
    //touchdevice = true
    decideOrientation();
    adaptToTouchDevice();
    //window.addEventListener("resize", adaptToChangedSize);
    if (touchdevice) {
        progressbar = document.querySelector("#progress-top");
    } else {
        progressbar = document.querySelector("#progress");
    }
    bindButtons();
    let savedgames = localStorage.getItem('SavedGame');
    savedgame = JSON.parse(savedgames);
    if (savedgame) {
        try {
            loadGame();
        } catch (err) {
            localStorage.clear();
        }
    } else {
        drawBoard(selectedboard);
        drawRack();
    }
    adaptToChangedSize();
    if (!savedgame && sack.length == 0) {
        selectLanguage(language);
        lockOffUI();
    }
}

function checkSavedGame() {
    let savedgames = localStorage.getItem('SavedGame');
    savedgame = JSON.parse(savedgames);
    if (savedgame) {   


        displayMessage("Figyelem!", "Az előző játék félbeszakadt.<br> Szeretnéd folytatni?", initGame, setupNewGame, "setup-new-game", "#setup-new-game");
    } else {
        setupNewGame();
    }
}

function setupNewGame() {
    try {
        popup1.remove();
    } catch (err) { }
    localStorage.setItem('SavedGame', JSON.stringify(false));
    document.querySelector("#setup-new-game").style.visibility = "visible";
    placeYesMarks();
}

function initStartScreen(){
    touchdevice = ('ontouchstart' in document.documentElement);
    if (touchdevice){
        document.querySelector("#start-screen").style.width = "100%";
        document.querySelector("#start-screen").style.height = "100%";
    }
    checkSavedGame();
}

initStartScreen();

